import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import Data from "./Data";


function San(value){

    return(
    <Card imageSrc={value.imageSrc} name=""/>

    )
}

ReactDOM.render(
    <>
    {Data.map(San)}
    </>,document.getElementById("root")
);
